import Task from "../Task/Task";
import "./Column.scss";

const Column = () => {
	return (
		<>
			<div className='column'>
				<header>To Do:</header>
				<ul className='task-list'>
					<li className='task-item'>
						<img src='https://picsum.photos/256/128' alt='alt text' />
						Design & Research
					</li>
					<li>Second</li>
					<li>Third</li>
					<li>Fourth</li>
					<li>Fifth</li>
					<li>Sixth</li>
					<li>Seventh</li>
					<li>Eigth</li>
					<li>Ninth</li>
					<li>Tenth</li>
					<li>Eleventh</li>
				</ul>
				<footer>+ New Card</footer>
			</div>
		</>
	);
};

export default Column;
